import React from 'react';
import '../../styles/pages/_profil.scss'

const index = () => {
    return (
        <div className="connection-form">
            <div className="form-container">
                <ul>
                    <li>Bienvenue !</li>
                    <li>
                        <p>Vous ne disposez pas <br/> de compte</p>
                    </li>
                    <li>S'inscrire</li>
                    <li>
                        <p>Vous possédez déjà</p>
                        <p>un compte</p>            
                    </li>
                    <li>Se connecter</li>
                </ul>
            </div>
        </div>
    );
};

export default index;
